csharp.source:
using Amazon.CDK.AWS.CloudWatch;
DeliveryStream deliveryStream;


// Alarm that triggers when the per-second average of incoming bytes exceeds 90% of the current service limit
MathExpression incomingBytesPercentOfLimit = new MathExpression(new MathExpressionProps {
    Expression = "incomingBytes / 300 / bytePerSecLimit",
    UsingMetrics = new Dictionary<string, IMetric> {
        { "incomingBytes", deliveryStream.MetricIncomingBytes(new MetricOptions { Statistic = Statistic.SUM }) },
        { "bytePerSecLimit", deliveryStream.Metric("BytesPerSecondLimit") }
    }
});

new Alarm(this, "Alarm", new AlarmProps {
    Metric = incomingBytesPercentOfLimit,
    Threshold = 0.9,
    EvaluationPeriods = 3
});

java.source:
import software.amazon.awscdk.services.cloudwatch.*;
DeliveryStream deliveryStream;


// Alarm that triggers when the per-second average of incoming bytes exceeds 90% of the current service limit
MathExpression incomingBytesPercentOfLimit = MathExpression.Builder.create()
        .expression("incomingBytes / 300 / bytePerSecLimit")
        .usingMetrics(Map.of(
                "incomingBytes", deliveryStream.metricIncomingBytes(MetricOptions.builder().statistic(Statistic.SUM).build()),
                "bytePerSecLimit", deliveryStream.metric("BytesPerSecondLimit")))
        .build();

Alarm.Builder.create(this, "Alarm")
        .metric(incomingBytesPercentOfLimit)
        .threshold(0.9)
        .evaluationPeriods(3)
        .build();

$.source:
import * as cloudwatch from '@aws-cdk/aws-cloudwatch';
declare const deliveryStream: firehose.DeliveryStream;

// Alarm that triggers when the per-second average of incoming bytes exceeds 90% of the current service limit
const incomingBytesPercentOfLimit = new cloudwatch.MathExpression({
  expression: 'incomingBytes / 300 / bytePerSecLimit',
  usingMetrics: {
    incomingBytes: deliveryStream.metricIncomingBytes({ statistic: cloudwatch.Statistic.SUM }),
    bytePerSecLimit: deliveryStream.metric('BytesPerSecondLimit'),
  },
});

new cloudwatch.Alarm(this, 'Alarm', {
  metric: incomingBytesPercentOfLimit,
  threshold: 0.9,
  evaluationPeriods: 3,
});

