using Amazon.CDK.AWS.Lambda.Nodejs;
using Amazon.CDK.AWS.Logs;
using Amazon.CDK.AWS.S3;
using Amazon.CDK;
using Amazon.CDK.AWS.KinesisFirehose.Destinations;

App app = new App();

Stack stack = new Stack(app, "aws-cdk-firehose-delivery-stream-s3-all-properties");

Bucket bucket = new Bucket(stack, "Bucket", new BucketProps {
    RemovalPolicy = RemovalPolicy.DESTROY,
    AutoDeleteObjects = true
});

Bucket backupBucket = new Bucket(stack, "BackupBucket", new BucketProps {
    RemovalPolicy = RemovalPolicy.DESTROY,
    AutoDeleteObjects = true
});
LogGroup logGroup = new LogGroup(stack, "LogGroup", new LogGroupProps {
    RemovalPolicy = RemovalPolicy.DESTROY
});

NodejsFunction dataProcessorFunction = new NodejsFunction(stack, "DataProcessorFunction", new NodejsFunctionProps {
    Entry = Join(__dirname, "lambda-data-processor.js"),
    Timeout = Duration.Minutes(1)
});

LambdaFunctionProcessor processor = new LambdaFunctionProcessor(dataProcessorFunction, new DataProcessorProps {
    BufferInterval = Duration.Seconds(60),
    BufferSize = Size.Mebibytes(1),
    Retries = 1
});

Key key = new Key(stack, "Key", new KeyProps {
    RemovalPolicy = RemovalPolicy.DESTROY
});

Key backupKey = new Key(stack, "BackupKey", new KeyProps {
    RemovalPolicy = RemovalPolicy.DESTROY
});

new DeliveryStream(stack, "Delivery Stream", new DeliveryStreamProps {
    Destinations = new [] { new S3Bucket(bucket, new S3BucketProps {
        Logging = true,
        LogGroup = logGroup,
        Processor = processor,
        Compression = Compression.GZIP,
        DataOutputPrefix = "regularPrefix",
        ErrorOutputPrefix = "errorPrefix",
        BufferingInterval = Duration.Seconds(60),
        BufferingSize = Size.Mebibytes(1),
        EncryptionKey = key,
        S3Backup = new DestinationS3BackupProps {
            Mode = BackupMode.ALL,
            Bucket = backupBucket,
            Compression = Compression.ZIP,
            DataOutputPrefix = "backupPrefix",
            ErrorOutputPrefix = "backupErrorPrefix",
            BufferingInterval = Duration.Seconds(60),
            BufferingSize = Size.Mebibytes(1),
            EncryptionKey = backupKey
        }
    }) }
});

app.Synth();

